import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Header from './Header';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects';
import Courses from './Courses';

function App() {
    return (
        <Router>
            <div className="App">
                <div className='main-page-container'>
                    <h1 className="Title">Hi,</h1>
                    <h1 className="Title">I'm Jerry,</h1>
                    <h1 className="Title">a Student @UChicago</h1>
                    <p className="Intro">I'm a third year undergrad majoring in Computer Science, Math, and Statistics. So far, I've explored a lot, from software engineering, data science, AI, research, to trading. My goal is to become a skilled tech person and contribute to the tech community, in any way possible.</p>
                    <div className="Links">
                        <Link to="/personalinfo">Personal Info</Link>
                        <Link to="/projects">Projects</Link>
                        <Link to="/courses">Courses</Link>
                    </div>
                </div>

                <Route path="/personalinfo" component={PersonalInfo} />
                <Route path="/projects" component={Projects} />
                <Route path="/courses" component={Courses} />
            </div>
        </Router>
    );
}

export default App;
